import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


export default function Save() {
  const notify = () => toast("Saved This Configuration!");

  return (
    <div className='Save'>
      <button onClick={notify}>Save</button>
      <ToastContainer />
    </div>

  )
}
